import logo from './logo.svg';
import './App.css';
import { 
  BrowserRouter, Routes, Route, useNavigate 
} from "react-router-dom";

import Login from './Screens/Login';
import Home from './Screens/Home';

function App() {
  return (
    <div className="App">
      <Routes>
      <Route path='/' element= {<Login/>}/>
      <Route path='/home' element= {<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
